import React from 'react'
import { useSelector } from 'react-redux'

export default function CounterViewer() {
    
    const storeData = useSelector(state=>state.counter)
    
    return (
        <div style={{border:"solid 3px blue", width:"200px", backgroundColor:"lightgray"}}>
            <h3>counter Viewer</h3>
            {storeData}
        </div>
    )
}
